ing in myself and to just plain not knowing what the hell I’m doing lmao. 😓⠀
⠀
This shop has been a vision of mine since I first became a mother. It took me years to bring it to life because I didn’t have the resources, skills, or knowledge to manifest it. It’s wild to see how much I’ve grown as an artist and entrepreneur in just a couple of years. I know so much more now than I give myself credit for. ⠀
⠀
When you buy from Tiny Trophy Shop, you’re not just buying a print or sticker, or poster or kit. You’re buying long nights of teaching myself a new program. You’re buying long days trying to configure a new machine. You’re buying the journey from idea to production and all the intensive research in between. You’re buying from a self taught artist, a mother looking to make extra income, and quite frankly, just a girl tryna make it out the hood. I’ve survived this life by making something out of nothing repeatedly and Tiny Trophy Shop... well, this is MY trophy. 🥺💘⠀
⠀
I truly hope that you’ll join me in celebrating our official launch on 9/8! It would also be awesome to see some familiar faces at the pop up tomorrow at @westernavearts. Please show love to my new business as you would a celebrity that doesn’t know your name or a big brand that doesn’t ask how your kids are doing. It means the world when I get a simple follow, share, like, or comment. Until lift off, P. 🚀";}i:134;a:1:{s:14:"comments_count";i:1;}i:135;a:1:{s:11:"likes_count";i:14;}i:136;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEurdZpnZSH";}i:137;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118820244_1145421045855153_9053905713696010008_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=vpJz4y2h3UEAX_cZZa9&oh=8ae451b17fb4a7000779afc2d0f00fac&oe=5F7A8D6B";}i:138;a:1:{s:4:"type";s:7:"sidecar";}i:139;a:1:{s:8:"owner_id";i:4461985056;}i:140;a:1:{s:14:"owner_username";s:0:"";}i:141;a:1:{s:14:"owner_fullname";s:0:"";}i:142;a:1:{s:9:"owner_pic";s:0:"";}i:143;a:1:{s:2:"id";s:19:"2391039193223883539";}i:144;a:1:{s:10:"short_code";s:11:"CEurXpcJWsT";}i:145;a:1:{s:12:"created_time";i:1599254105;}i:146;a:1:{s:7:"caption";s:682:"TODAYS CARTOON LOOK IS HIGHLY INSPIRED BY PETER GRIFFIN FROM FAMILY GUY - looks like we are off to Quohog - Give me a beer 🍺 or 2 😂 
